import pandas as pddef generar_conjuntos(parametros:dict, file:str)->dict:        parametros['conjuntos'] = dict()        # Empresas    empresas_df = pd.read_excel(file, sheet_name='empresas')    parametros['conjuntos']['empresas'] = empresas_df['empresa'].to_list()    # Calendario    periodos_df = pd.read_excel(file, sheet_name='periodos')    parametros['conjuntos']['periodos'] = {periodos_df.loc[i]['Id']: periodos_df.loc[i]['Fecha'] for i in periodos_df.index}    parametros['conjuntos']['fechas'] = {periodos_df.loc[i]['Fecha']: periodos_df.loc[i]['Id'] for i in periodos_df.index}    parametros['periodos'] = len(parametros['conjuntos']['periodos'])    # Ingredientes    ingredientes_df = pd.read_excel(file, sheet_name='ingredientes')    parametros['conjuntos']['ingredientes'] = ingredientes_df['ingrediente'].to_list()    # Puertos    puertos_df = pd.read_excel(file, sheet_name='puertos')    parametros['conjuntos']['puertos'] = puertos_df['puerto'].to_list()    # plantas    plantas_df = pd.read_excel(file, sheet_name='plantas')    plantas_df['key'] = plantas_df.apply(lambda x:x['empresa'] + "_" + x['planta'], axis=1)    parametros['conjuntos']['plantas'] = plantas_df['key'].to_list()    # Unidades de almacenamiento    unidades_df = pd.read_excel(file, sheet_name='unidades_almacenamiento', skiprows=1)    parametros['conjuntos']['unidades_almacenamiento'] = unidades_df['key'].to_list()        # Cargas      inventarios_puerto_df = pd.read_excel(file, sheet_name='cargas_puerto')    parametros['conjuntos']['cargas'] = list(inventarios_puerto_df['key'].unique())                